<http://publications.europa.eu/resource/celex/32018L2001>
  dc:title "Directive (EU) 2018/2001 of the European Parliament and of the Council" ;
  eli:isPartOf <http://data.europa.eu/eli/dir/2018/2001/oj> .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN>
  dc:title "Article 25" ;
  skos:inScheme <http://publications.europa.eu/resource/celex/> ;
  skos:notation "EU_32018L2001_Title_0_Chapter_0_Section_0_Article_25" .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN_Paragraph_1>
  dc:description """In order to mainstream the use of renewable energy in the transport sector, each Member State shall set an obligation on fuel suppliers to ensure that the share of renewable energy within the final consumption of energy in the transport sector is at least 14 % by 2030 (minimum share) in accordance with an indicative trajectory set by the Member State and calculated in accordance with the methodology set out in this Article and in Articles 26 and 27.""" .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN_Paragraph_2>
  dc:description """The greenhouse gas emissions savings from the use of renewable liquid and gaseous transport fuels of non-biological origin shall be at least 70 % from 1 January 2021.""" .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN_Paragraph_2_Sentence_1>
  dc:description """The greenhouse gas emissions savings from the use of renewable liquid and gaseous transport fuels of non-biological origin shall be at least 70 % from 1 January 2021.""" .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN_Paragraph_2_Sentence_2>
  dc:description """By 1 January 2021, the Commission shall adopt a delegated act in accordance with Article 35 to supplement this Directive by establishing appropriate minimum thresholds for greenhouse gas emissions savings of recycled carbon fuels through a life-cycle assessment that takes into account the specificities of each fuel.""" .

<http://publications.europa.eu/resource/celex/32018L2001_Art25_EN_Annotator_1>
